          "items": [{
            "field": "description",
            "fieldtype": "jira",
            "from": null,
            "fromString": null,
            "to": null,
            "toString": "As a product owner I want to understand _how much time the delivery team spends fixing bugs vs developing new features_ and the dynamics of this ratio over time\r\nso that I can visually assess efficiency of our development process by looking on a nice histogram\r\nh2. Details\r\n\r\nBuild a bar chart (histogram) that consists of a series of *'Fix vs Feature work' ratios*, each calculated as the time spent \"in progress\" for one type of issue divided by the same time for another type of issue.\r\n * Assume that you need to calculate ratios for issues of two different issue types (Type1='bug' and Type2='user story').\r\n * By default, the chart should present this information for the last 3 month with data aggregated by week (approx 12 vertical bars). The smallest granularity step is one day.\r\n * Trend line should be displayed on the chart, similar to the trendline on a throughput report chart.\r\n\r\nFurther customisation will enable:\r\n # Selecting custom time periods;\r\n # Selecting data aggregation intervals (day/week/month);\r\n # Selecting types of issues and related statuses\r\n\r\nThis will be implemented separately by other user stories.\r\nh2. Acceptance Criteria\r\n * Histogram chart reflecting Fix vs Feature work time ratio for the last 3 months with the data aggregated by week and a trend line is built using mock data."
          }, {
            "field": "summary",
            "fieldtype": "jira",
            "from": null,
            "fromString": "Visualise Fix vs Feature time ratio",
            "to": null,
            "toString": "Visualise Fix vs Feature time histogram"
          }]
