            "to": null,
            "toString": "As a ZMetrics user\r\n I want to see a linear trend line on a throughput report\r\n So that I understand if my team's throughput grows or falls over time and take actions accordingly\r\nh3. Details\r\n\r\nAdd a linear trend line should be added to the Throughput report calculated as _y=mx+b_where m and b calculated as described [HERE|https://classroom.synonym.com/calculate-trendline-2709.html]\r\n\r\nCONSIDER MAKING IT REUSABLE AS THIS KIND OF A TREND LINE WILL BE USED ON MANY CHARTS\r\nh3. Acceptance Criteria\r\n\r\nLinear trend line is added to the chart and with starting and end-point coordinates calculated as described above. See attached image as an example."
