            "to": null,
            "toString": "An epic to track delivery of Throughput report in zMetrics\r\n\r\nThroughput report is a bar chart/histogram with bars reflecting a number of issues resolved/closed within a given time interval (day, week, month), historically.\r\n\r\nSee attached picture as an example of a basic histogram chart.\r\n\r\nDifferent filters can be applied to refine the report - grouping issues by the date range, selecting/excluding types of issues (bugs, stories, tasks).\r\n\r\nThe default time interval will be 3 month (or less if no earlier data), grouped by day.\r\n\r\nUseful additions:\r\n # Line reflecting average value for displayed time period\r\n # Linear trend line calculated as y=mx+b, where m and b are calculated as described here:[https://classroom.synonym.com/calculate-trendline-2709.html]"
