          "items": [{
            "field": "description",
            "fieldtype": "jira",
            "from": null,
            "fromString": null,
            "to": null,
            "toString": "As an uzMer interested to dig deeper/zoom into LTR/CTR chart\r\nI want to narrow down the timeframe of the report by selecting start and end time\r\nSo that I am able to see information for the selected timeframe only on the chart\r\nh3. Details\r\n\r\nAn additional filter should be added to the report page, that allows selecting 2 dates as a bracket for the chart. The default parameters are the whole period. The user should be able to select from pre-set data intervals:\r\n * Whole period\r\n * Last 3 month\r\n * Last month\r\n * Last 2 weeks\r\n * Custom - ask to enter a custom data range within the whole period\r\n\r\nh3. Acceptance Criteria\r\n * A drop down date selection added to the report filters\r\n * After the time bracket is selected the LT/CT chart should reflect the data for the selected timeframe only\r\n\r\n"
          }, {
            "field": "summary",
            "fieldtype": "jira",
            "from": null,
            "fromString": "Select Time Period for the report",
            "to": null,
            "toString": "Select Time Period for the LT/CT Chart"
          }]
