            "fromString": "As a ZMetricsuser\r\n\r\nI want to know lead time for my Jira project\r\n\r\nSo that I can analysethedynamics of value delivery\r\n\r\n*Details*\r\n\r\nLead time - time from creating a request to delivering the feature to the client.\r\n\r\nIn Jira project case it is the time from creating the first ticket to resolving/closing the last ticket in the project. For every day of the project, we need to calculate the average lead time for all the tickets that were resolved by this date. We need to ignore tickets that are not in the last workflow phase.\r\n\r\n*Acceptance Criteria*\r\n\r\nA table with the average lead time for every day of the entire project is produced as an html page",
            "to": null,
            "toString": "As a ZMetricsuser\r\nI want to know lead time for my Jira project\r\nSo that I can analysethedynamics of value delivery for the whole project.\r\n\r\n*Details*\r\n\r\nLead time - time from creating a request to delivering the feature to the client.\r\n\r\nIn Jira project case it is the time from creating the first ticket to resolving/closing the last ticket in the project. For every day of the project, we need to calculate the average lead time for all the tickets that were resolved by this date. We need to ignore tickets that are not in the last workflow phase.\r\n\r\n*Acceptance Criteria*\r\n\r\nA table with the average lead time for every day of the entire project is produced as an html page"
