          "items": [{
            "field": "description",
            "fieldtype": "jira",
            "from": null,
            "fromString": "As a Scrum Master reporting to Product Stakeholders\n\nI want to visualise the Flow Efficiency over time for one team\n\nSo that I can report how much waste there is in the system\n\n\n{code}\nFlow Efficiency = Work Time / (Work Time + Wait Time) x 100%\n{code}\n",
            "to": null,
            "toString": "As a Team Member keen in reducing Variability\n\nI want to visualise the Flow Efficiency over time for my team\n\nSo that I can have an indicator of the waste in the system\n\n\n{code:java}\nFlow Efficiency = Work Time / (Work Time + Wait Time) x 100%\n{code}\n"
          }]
